import React, { Component } from "react";
import "../assets/img/apple-icon.png";
import "../assets/img/favicon.ico";
import "../assets/css/bootstrap.min.css";
import "../assets/css/light-bootstrap-dashboard.css?v=2.0.0 ";
import { BrowserRouter, Route, Link , Redirect, Router} from 'react-router-dom';

export default class CommonMenu extends Component {
  state = {};

  render() {
    return (
      <div style={{ width:"100%" , display: "block" }}>
        <nav className="navbar navbar-expand-lg " color-on-scroll="500">


          <div
            className="collapse navbar-collapse justify-content-end"
            id="navigation"
          >

            <ul className="navbar-nav ml-auto">
            <li className="nav-item"><Router><Link from={"/home"} to={"/login"}>
                <a className="nav-link">
                <span className="no-icon" value="Register" >Register</span>
                </a>
                </Link></Router>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="#pablo">
                  <span className="no-icon">Log in</span>
                </a>
              </li>


            </ul>
          </div>
        </nav>
      </div>
    );
  }
}
